import "./interests.scss";
import VerticalTabs from '../verticalTabs/VerticalTabs';

export default function Interests() {
    const tabs = [
        {
          label: 'Airtifical Intelligence',
          content: <div>This is AI tab</div>,
        },
        {
          label: 'Data Science',
          content: <div>This is data science tab</div>,
        },
        {
          label: 'Deep Learning',
          content: <div>This is deep learning tab</div>,
        },
        {
            label: 'Computer Vision',
            content: <div>This is computer vision tab</div>,
        },
      ];
    return (
        <div className="interests">
          <p class="sectionHeading">What I do?</p>
            <VerticalTabs tabs={tabs} />
        </div>
    )
}
